function sendLoginRequest() {

    // 手动构造一个 POST json 格式请求
    const loginRequest = {
        url: "http://10.234.196.18:8082/auth/login",
        method: "POST",
        // body 为 json 格式
        header: {
            "Content-Type": "application/json", // 注意：header 需要加上 Content-Type
        },
        body: {
            // 此处为 raw
            mode: 'raw',
            // 序列化后的 json 字符串
            raw: JSON.stringify(
                {
                    "username": "张三",
                    "password": "123456",
                }
            ), 
        }
    };

    // 发送请求
    pm.sendRequest(loginRequest, function (err, res) {
        if (err) {
            console.log(err);
        } else {
            // 读取接口返回的 json 数据
            const jsonData = res.json();
            
            // 将 token 凭证写入环境变量 ACCESS_TOKEN
            pm.environment.set("ACCESS_TOKEN", jsonData.data.accessToken);
            
            // 将 accessTokenExpires 过期时间写入环境变量 ACCESS_TOKEN_EXPIRES
             pm.environment.set(
                 "ACCESS_TOKEN_EXPIRES",
                 jsonData.data.accessTokenExpires
             );
        }
    });
}

